import { registerDomainSuccess } from './domainSlice';
import { useNavigate } from 'react-router-dom';
import { store } from './store'


export const domainService = {
    async setDomain(id, domain) {
        const res = await fetch('http://localhost:8000/api/addUserDomains', { credentials: 'include', mode: "cors", headers: { 'Content-Type': 'application/json' }, method: 'post', body: JSON.stringify({id :id, domain: domain}) });
        if (!res.ok) {
            throw new Error(res.status);
        }
        // Dispatch the loginSuccess action with the user data
        //store.dispatch(domainSuccess(domain));
    },
    async registerDomain(id) {
        let res = await fetch('http://localhost:8000/api/createUserDomains', { credentials: 'include', mode: "cors", headers: { 'Content-Type': 'application/json' }, method: 'post', body: JSON.stringify(id)});
        if (!res.ok) {
            throw new Error(res.status);
        }
        // Dispatch the loginSuccess action with the user data
        res = res.json();
        store.dispatch(registerDomainSuccess(res.domains));
    },
};
